import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import ReportCard from './ReportCard.jsx';
import fetchData from './fetchCall.jsx';
import PriceCard from './PriceCard.jsx'



const URL = "http://192.168.1.106:3000/api/v2.1/child/5d7220faecdf45753ff2c0a8/dashboard";
const accessToken = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjVkNzIyMDZhZWNkZjQ1NzUzZmYyYzBhNiIsImlhdCI6MTU2Nzc2MDU4OX0.2jQoghVsgNKp3zBsX1dg6my9X1p8TqiCcLkAjKkwqCw";

const Dashboard = () => {

  const [dashboardData, setDashboardData] = useState([{ data: [], status: 'INIT' }]);
  const [status, setStatus] = useState('');

  const getAssessment = async () => {
    const response = await fetchData(URL, accessToken);
    await setDashboardData(response.data.data.data);
    await setStatus(response.status);
    return response.data.data.data;
  };

  useEffect(() => {
    getAssessment().then((data) => console.log(data))
  }, []);


  return (
    <div className="w3-container" style={{ width: '100%' }}>
      <Link to="/"><button className="w3-button w3-white w3-xxlarge" type="button" style={{ margin: 0, padding: '8px' }}>&#9776;</button></Link>
      {(status === 'SUCCESS') ? (
        <>
          <div className="w3-container">
            <div className="w3-display-container w3-right">
              <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-circle" style={{ width: '110px' }} />
              <i style={{ paddingRight: '1em', paddingBottom: '1em' }} className="w3-circle fa fa-caret-down w3-display-bottomright" />

            </div>
            <h4 style={{ marginTop: '1em', marginBottom: 0, fontSize: '2em' }} className="w3-text-gray"><b>Hello,</b></h4>
            <h4 style={{ margin: 0, fontSize: '2em' }}><b>Sangeetha</b></h4>
            <div className="w3-margin-top w3-round-xlarge w3-center w3-right" style={{ backgroundColor: 'lightgray' }}>
              <div className="" style={{ padding: '0.5em 1em', }}>Hari Krishna</div>
            </div>
            {/* <h4  className="w3-right">Hari Krishna</h4> */}
          </div>
          <div className="w3-container w3-margin-top">
            <p className="w3-text-gray" style={{ fontSize: '1.3em' }}>
              hey hai hello welcome all hey hai hello welcome all  hey hai hello welcome
              {/* {dashboardData.welcomeText} */}
            </p>
          </div>

          {/* {dashboardData.tracks.map((track) => {
            return (<ReportCard key={track.key} data={{ heading: track.cardTitle, image: track.images[0], text: track.trackStatus, buttonBgColor: track.buttonBgColor, cardColor: track.cardColor }} />);
          })} */}

          <ReportCard data={{ heading: 'Social Ability Genius', image: 'https://www.w3schools.com/w3css/img_avatar3.png', text: 'Unlock Now' }} />
          <PriceCard data={{ heading: "Unlock all 7 genius tests", text: "Worth 1399 Limited time offer.", price: "Rs 699 only!", color: "blue" }} />
          <ReportCard data={{ heading: 'Social Ability Genius', image: 'https://www.w3schools.com/w3css/img_avatar3.png', text: 'Unlock Now' }} />
          <ReportCard data={{ heading: 'Social Ability Genius', image: 'https://www.w3schools.com/w3css/img_avatar3.png', text: 'Unlock Now' }} />
          <ReportCard data={{ heading: 'Social Ability Genius', image: 'https://www.w3schools.com/w3css/img_avatar3.png', text: 'Unlock Now' }} />
          <ReportCard data={{ heading: 'Social Ability Genius', image: 'https://www.w3schools.com/w3css/img_avatar3.png', text: 'Unlock Now' }} />
          <PriceCard data={{ heading: "Unlock all 7 genius tests", text: "Worth 1399 Limited time offer.", price: "Rs 699 only!", color: "blue" }} />

          {/* <div className="w3-container">
      <Link to="/assessments"><p className="w3-center w3-text-gray"><b>Unlock all 7 remaining assessments</b></p></Link>
    </div> */}
          {/* <div className="w3-container">
      <div className="w3-round-xxlarge w3-center w3-margin-bottom" style={{ backgroundColor: 'rgb(255, 104, 153)' }}>
        <p className="w3-padding-16" style={{ margin: 0 }}><b>Worth Rs.1393 for only Rs.699</b></p>
      </div>
    </div > */}
        </>
      ) : (
          <div key={0} className="w3-center w3-xlarge">
            Loading...
      </div>
        )}

    </div>
  );
}

export default Dashboard;
